using System;
using System.Text.RegularExpressions;

namespace Day5b
{
    class Program
    {
        private const string input = @"";
        
        private const string test = @"dabAcCaCBAcCcaDA";
        const int diff = 'a' - 'A';
        
        
        public static void Main(string[] args)
        {
            string polymer = input;
            int min = polymer.Length + 1;
            char removedChar = 'a';
            string finalPolymer = "";
            
            for(int i = 0; i < 26; i += 1) {
                var pattern = string.Format("[{0}{1}]", (char)('a' + i), (char)('A' + i));
                var reducedPolymer = Regex.Replace(polymer, pattern, "");
                reducedPolymer = Reduce(reducedPolymer);
                if(min > reducedPolymer.Length) {
                    min = reducedPolymer.Length;
                    removedChar = (char)('a' + i);
                    finalPolymer = reducedPolymer;
                }
            }

            
            Console.WriteLine("The final polymer is: {0}, with a length of {1} after the letter {2} was removed.", finalPolymer, min, removedChar);
            Console.Write("Press any key to continue . . . ");
            Console.ReadKey(true);
        }
        
        public static string Reduce(string polymer) {
            int endlength = polymer.Length;
            for(int i = 0; i < endlength - 1; i += 1) {
                if(Math.Abs(polymer[i] - polymer[i+1]) == diff) {
                    polymer = polymer.Substring(0,i) + polymer.Substring(i+2);
                    i = Math.Max(-1, i-2);
                    endlength -= 2;
                }
            }
            return polymer;
        }
    }
}